import { toHaveDisplayValue } from '@testing-library/jest-dom/dist/matchers';
import React, { Component } from 'react'
import Select from 'react-select'
import 'bootstrap/dist/css/bootstrap.min.css';

export class DisplayPanel extends Component {
    constructor(props){
        super(props);
        this.state = {category: '', bundle: ''}
        this.categoryOptions = [
          {label: 'Love Frames', value: '5ff5a1d93bbf9374326985de'},
          {label: 'Comic Frames', value: '5ff7fab5f0dfd4c8479c5912'},
          {label: 'Birthday Frames', value: '5ff5a1d93bbf9374326985db'},
          {label: 'Magazine Frames', value: '5ff7fab5f0dfd4c8479c5913'},
          {label: 'News Frames', value: '5ff7fab5f0dfd4c8479c5914'},          
        ]
        this.bundleOptions = [
          {label: 'Bundle 1', value: 'bundle1'},
          {label: 'Bundle 2', value: 'bundle2'},
          {label: 'Bundle 3', value: 'bundle3'},
          {label: 'Bundle 4', value: 'bundle4'},
          {label: 'Bundle 5', value: 'bundle5'},
          {label: 'Bundle 6', value: 'bundle6'},
          {label: 'Bundle 7', value: 'bundle7'},
          {label: 'Bundle 8', value: 'bundle8'},
          {label: 'Bundle 9', value: 'bundle9'},
          {label: 'Bundle 10', value: 'bundle10'},
          {label: 'Bundle 11', value: 'bundle11'},
        ]
        this.handleSubmit = this.handleSubmit.bind(this);
    }

    async handleSubmit(event){

    }

  render() {
    return (
        <>
        {/* {this.onDataChange()} */}
      <div>DisplayPanel</div>
      <Select className='col-3' options={this.categoryOptions}/>
      <Select className='col-3' options={this.bundleOptions}/>

      <select name="selectList" id="selectList" onChange={this.bundleChange}>
                 <option value="bundle1">Bundle 1</option>
                 <option value="bundle2">Bundle 2</option>
                 <option value="bundle3">Bundle 3</option>
                 <option value="bundle4">Bundle 4</option>
                 <option value="bundle5">Bundle 5</option>
                 <option value="bundle6">Bundle 6</option>
                 <option value="bundle7">Bundle 7</option>
                 <option value="bundle8">Bundle 8</option>
                 <option value="bundle9">Bundle 9</option>
                 <option value="bundle10">Bundle 10</option>
                 <option value="bundle11">Bundle 11</option>
                 
      </select>

      {/* <Select options={this.temp} /> */}

      <br/>
      {
        
        this.props.data.map(result=>(
          <>
            
            {/* <img src={result}></img> */}
          </>
        ))
      }
      </>
    )
  }
}

export default DisplayPanel
